import {Component, OnInit, Output} from '@angular/core';
import {ActivatedRoute, Router} from "@angular/router";
import {Event} from "../../models/event";
import {Tag} from "../../models/tag";
import {MetaData} from "../../models/metadata";
import * as moment from 'moment';

@Component({
  selector: 'app-event-details',
  templateUrl: './event-details.component.html',
  styleUrls: ['./event-details.component.css']
})
export class EventDetailsComponent implements OnInit {
  @Output()
  public id!: string | null;

  constructor(public router: Router,
              public activatedRoute: ActivatedRoute) {
  }

  tmpEvent: Event = new Event();

  // TODO: If id could not be found redirect or separate 404-page?
  ngOnInit(): void {
    this.id = this.activatedRoute.snapshot.paramMap.get('id');

    this.tmpEvent.image = 'data:image/jpeg;base64,' + '';

    this.tmpEvent.metadata = new MetaData();
    this.tmpEvent.metadata.event_id = '6f8100b3-2e32-11e9-927b-dca9047ef277';
    this.tmpEvent.metadata.state = 'CORRECT';
    this.tmpEvent.metadata.dev_id = 'f40ed0af-b896-4eee-923b-2290e888451b';
    this.tmpEvent.metadata.dev_name = 'GRASMERE 1';
    this.tmpEvent.metadata.timestamp = moment('13-Apr-2019 (04:35:23.000000)', 'DD-MMM-YYYY (HH:mm:ss.SSSSSS)').toDate();
    this.tmpEvent.metadata.created = this.tmpEvent.metadata.timestamp;
    this.tmpEvent.metadata.updated = this.tmpEvent.metadata.timestamp;
    this.tmpEvent.metadata.place_ident = '342Cc014';
    this.tmpEvent.metadata.event_frames = 1;
    this.tmpEvent.metadata.frame_num = 1;
    this.tmpEvent.metadata.longitude = -114.54629944857007;
    this.tmpEvent.metadata.latitude = 43.59906419077267;

    this.tmpEvent.tags = [new Tag()];
    this.tmpEvent.tags[0].name = "base";
    this.tmpEvent.tags[0].image = this.tmpEvent.image;
    this.tmpEvent.tags[0].created = this.tmpEvent.metadata.timestamp;
  }

}
